INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (7, 1, 2, "フリーマーケット会場", 40, 0, 91002, 2834, 8, "ペコリーヌとの出会い", "青空の下で謁見", 5118061, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (7, 1, 2, "フリーマーケット会場", 40, 0, 91002, 2835, 8, "マホとの出会い", "未来の騎空団\nマスコット？", 5118062, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (7, 1, 2, "ランドソル市街地", 40, 0, 91002, 2837, 8, "アキノとの出会い", "お嬢さまからの\n緊急依頼", 5118063, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 2, "フリーマーケット会場", 40, 0, 91002, 4108402, 8, "ジュンとの出会い", "黄金色の悩みごと", 5118064, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 2, "フリーマーケット会場", 40, 0, 91002, 4107402, 8, "カオリとの出会い", "白熱！　格闘大会！", 5118065, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (16, 1, 2, "オーエド町", 40, 1, 91002, 9000227, 8, "ニノンとの出会い", "祭り太鼓はオーエドの華", 5118066, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (19, 1, 3, "フリーマーケット会場", 40, 0, 91002, 2101181, 8, "スズナとの出会い", "人気者は遅れて\nやってくる", 5118067, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 3, "ランドソル市街地", 40, 0, 91002, 4109402, 8, "ナナカとの出会い", "巫女・ミーツ・魔法少女", 5118068, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 3, "フリーマーケット会場", 40, 0, 91002, 4305402, 8, "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", 5118069, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 3, "ランドソル市街地", 40, 0, 91002, 4101402, 8, "ユカリとの出会い", "この出会いにカンパイ！", 5118070, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (18, 1, 3, "ランドソル市街地", 40, 0, 91002, 4106402, 8, "アオイとの出会い", "陰陽アンサンブル", 5118071, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (7, 1, 3, "フリーマーケット会場", 40, 1, 91002, 2836, 8, "シノブとの出会い", "運試し十番勝負！", 5118072, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 20063115);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES (0, 0, 1, 0, 0, 0, 0, 0, 0, "オープニング", "彼女たちの新たな日常", 5118600, 10118, 0, 20063115);
